import React, {memo, useCallback} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const FDetailPagesContainer = styled.div`
    width:100%;

    .contentContainer{
        max-width:1200px;
        margin: 140px auto 80px;

        .topContent{
            .titleWrap{
                width:100%;
                border-top:3px solid #333333;
                border-bottom: 1px solid #D9D9D9;
                height:80px;
                display: flex;
                justify-content: space-between;
                align-items: center;
                padding:0 20px;

                .title{
                    height: auto;
                    font-size:28px;
                    font-weight: 500;
                }

                .date{
                    width:max-content;
                    white-space: nowrap;
                    text-align: left;
                    color: #959595;
                }
            }

            .bannerImgWrap{
                width:800px;
                margin:50px auto;

                .img{
                    max-width: 800px;
                    text-align: center;
                }
            }
        }
        .summaryWrap{
            margin-top:60px; 

            .title{
                height: auto;
                font-size:24px;
                font-weight: 500;
                margin-bottom:20px;
            }

            .formTable{
                width:100%;

                tbody{
                    border-top:2px solid #333333;

                    tr{
                        height: auto;
                        line-height: 1.3;
                        border-bottom:1px solid #D9D9D9;

                        .row{
                            padding:20px;
                            vertical-align: middle;
                        }

                        td{
                            padding:20px;
                            vertical-align: middle;
                        }
                    }
                }
            }
        }

        .home{
            margin: 60px auto 80px;
            width:auto;
            height:auto;
            padding:13px 60px;
            border:1px solid #34964B;
            border-radius: 2px;
            cursor: pointer;

            display: flex;
